        <div className={s.title}>Big SALE 200%</div>
        <div className={s.product}>
            <div className={s.text}>
                <div className={s.subtitle}>the best of the best 2002</div>
                <h1 className={s.head}>LEMON r2d2 vedroDroid 5099 AI</h1>
                <button className={s.button}>Shop</button>
            </div>
            <div className={s.image}>
                <img src={BG} alt="BG"/>
            </div>
        </div>
    </section>
);

export default Poster;
